import React from "react"
import { deleteJobs } from "../utils/api"
import { useNavigate } from "react-router"

function Jobs (job){
const navigate = useNavigate()

if(job.length){
   return job.map((job, index) => {
      return (
      <>
         <ul>
            <li key={index}>
               <p>{job.neighborhood}</p>
               <p>{job.picture}</p>
               <p>{job.worker}</p>
               <p>{job.date}</p>
            </li>
            <button onClick={() => {
               deleteJobs(job)
               .then(navigate('/jobs'))
            }}>Delete
            </button>
         </ul>
      </>
         )
   })
      
   }
      
}
    export default Jobs
